const e=JSON.parse('{"key":"v-627fe3d7","path":"/quality/design-mode/design-overview.html","title":"设计模式","lang":"zh-CN","frontmatter":{},"headers":[{"level":2,"title":"设计模式的六大原则","slug":"设计模式的六大原则","link":"#设计模式的六大原则","children":[]},{"level":2,"title":"设计模式分类","slug":"设计模式分类","link":"#设计模式分类","children":[]}],"git":{"createdTime":1653582123000,"updatedTime":1654872324000,"contributors":[{"name":"xuliang","email":"895252461@qq.com","commits":2}]},"readingTime":{"minutes":1.75,"words":524},"localizedDate":"2022年5月27日","filePathRelative":"quality/design-mode/design-overview.md","excerpt":"<h1> 设计模式</h1>\\n<p>设计模式（Design pattern）代表了最佳的实践，通常被有经验的面向对象的软件开发人员所采用。设计模式是软件开发人员在软件开发过程中面临的一般问题的解决方案。这些解决方案是众多软件开发人员经过相当长的一段时间的试验和错误总结出来的。</p>\\n<h2> 设计模式的六大原则</h2>\\n<p>略</p>\\n<h2> 设计模式分类</h2>\\n<p>设计模式总共有 23 种设计模式。这些模式可以分为三大类：创建型模式（Creational Patterns）、结构型模式（Structural Patterns）、行为型模式（Behavioral Patterns）。</p>"}');export{e as data};
